// DATASET: breweries from ./datasets/breweries
const breweryPrompts = {
  getBeerCount() {
    // Return the total beer count of all beers for every brewery e.g.
    // 40

    const result = breweries.reduce((acc, beers) => {
      acc += beers.beers.length
      return acc
    }, 0);
    return result;

    // Annotation:
    // Write your annotation here as a comment
  },

  getBreweryBeerCount() {
    // Return an array of objects where each object has the name of a brewery
    // and the count of the beers that brewery has e.g.
    // [
    //  { name: 'Little Machine Brew', beerCount: 12 },
    //  { name: 'Ratio Beerworks', beerCount: 5},
    // ...etc.
    // ]
    const result = []
    breweries.forEach(brewery => {
      let obj = {}
      obj.name = brewery.name
      obj.beerCount = brewery.beers.length
      result.push(obj)
    })
    return result;

    // Annotation:
    // Write your annotation here as a comment
  },

  findHighestAbvBeer() {
    // Return the beer which has the highest ABV of all beers
    // e.g.
    // { name: 'Barrel Aged Nature\'s Sweater', type: 'Barley Wine', abv: 10.9, ibu: 40 }

    const beers = breweries.map(brewery => brewery.beers)
    const beerData = []
    beers.forEach(array => {
      array.forEach(beer => {
        beerData.push(beer)
      })
    })

    beerData.sort((beerA, beerB) => beerB.abv - beerA.abv)
    return beerData[0]

    // Annotation:
    // Write your annotation here as a comment
  }
};






